import './App.css';

function App() {
  const blogobj = {
    title: 'blog title',
    Description: ' new lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor',
  }




  return (
      <div className="App">
        <div>
            <h3>{blogobj.title}</h3>
            <p>{blogobj.Description}</p>

        </div>
        <hr></hr>
